"""# 데이터 처리

## DataFrame으로 불러오기

csv 파일은 아래와 같이 Pandas의 read_csv 함수를 이용하여 DataFrame을 만들 수 있다. 

아래 코드를 실행하면 df 라는 이름의 컨테이너에 DataFrame의 형태로 저장되어 있게 된다.
"""

#package 불러오기
import pandas as pd

#데이터가 저장되어 있는 폴더명 설정
base_dr = 'AWS_data/'
filename = 'SURFACE_ASOS_116_MI_2018-01_2018-01_2018.csv'

df = pd.read_csv('{0}{1}'.format(base_dr, filename),
                 thousands = ',',
                 encoding= 'euc-kr')
df

"""df에 저장되어 있는 앞부분, 마지막 부분의 자료를 보자. 

1분 간격으로 기온, 누적강수량, 풍향, 풍속.... 등의 자료가 저장되어 있음을 알 수 있다.

df.head(), df.tail(), df.describe() 등으로 dataframe 내용을 확인해 볼 수 있다.
"""

df.head()

df.tail()

df.describe()

"""df에 저장된 총 레코드 수는 len 함수로 확인해 볼 수도 있다. """

len(df)

"""## 일시 자료를 datetime으로 변환하기

AWS 자료는 시간에 따라 측정한 자료로 시계열 자료(time series data)로 처리하면 매우 유리하다. Python에서는 날짜와 시간 관련하여  [time](https://docs.python.org/ko/3/library/time.html), [datetime](https://docs.python.org/3/library/datetime.html), [calendar](https://docs.python.org/3/library/calendar.html#module-calendar)이 있는데, 이 사용법을 잘 익혀 두는 것이 좋겠다.

먼저  ['일시'] 컬럼의 data type을 확인해 보자. 인덱싱 [0]번을 택하여 첫번째 데이터의 자료의 데이터형(type)을 확인해 보자.
"""

print("type(df['일시'][0]):{}".format(type(df['일시'][0])))

"""우리가 날짜 시간으로 생각한 컬럼은 그저 문자열(str)임을 확인할 수 있다. 

시계열 자료를 처리하기 위해서 문자열을 to_datetime 메소드를 이용하여 timestamp로 변환해 보자.
"""

df['dt_YmdHM'] = pd.to_datetime(df['일시'])
df

"""['dt_YmdHM'] 이라는 컬럼이 하나 추가되었다. 이 컬럼에는 어떤 data type이 들어 있는가?

timestamp로 시간을 계산할 수 있는 상태가 되었다.
"""

print("type(df['dt_YmdHM'][0]):{}".format(type(df['dt_YmdHM'][0])))

"""## timestamp를 index 지정

이제 timestamp가 들어 있는 ['dt_YmdHM'] 컬럼을 index로 지정하는 것이 좋겠다. 
"""

df.index = df['dt_YmdHM']
df

"""## 데이터 시간 변경

데이터를 보니 1분 간격으로 저장한 것 같고, 시작이 2018-01-01 00:01, 끝이 2018-02-01 00:00 인 것으로 보아 ['일시'] 컬럼의 시간 직전 1분간의 자료가 저장되어 있음을 알 수 있다.

이대로 사용하게 되면 어느날의 마지막 23:59~00:00의 자료가 다음날의 날짜로 저장되어 통계를 산출할때 불편함이 있을 것이다. 

datetime을 이용하여 각각의 일평균, 월평균을 산출하기 위하여 1분씩 빼서 저장하는 것이 더 나을것 같다. 1분씩 뺀 후에 다시 index로 지정해 주자.
"""

from datetime import timedelta
df['dt_YmdHM-1min'] = df['dt_YmdHM'] - timedelta(minutes = 1)
df.index = df['dt_YmdHM-1min']
df

"""# 데이터 시각화

matplotlib을 이용하여 다은과 같이 간단하게 시각화해볼 수 있다. 약 4만개의 레코드를 시각화 하는 것이라 시간이 너무 많이 소요되는 관계로 1000개의 레코드만 실행해 보자.

> df['일시'][:1000]

> df['기온(°C)'][:1000]
"""

import matplotlib.pyplot as plt

# 그림 사이즈를 가로로 길게 지정
fig, ax = plt.subplots(figsize=(15,5))

ax.plot(df['일시'][:1000], df['기온(°C)'][:1000])

ax.set_xlabel('time', fontsize = 14)
ax.set_ylabel('air temperature (°C)', fontsize = 14)

ax.set_title('Variation of air temperature at Mt. Gwanak in Jan.', 
          y=1.05,   # margin under the title.
          fontdict={'fontsize':18,'fontweight':'bold'})

plt.show()

